import React from 'react';

const User = ({user}) => {
  return (
    <div>
      <b>{user.username}</b><span>({user.email})</span>
    </div>
  )
} 
const UserList = () => {
  const users = [
    {
      id: 1,
      username: 'rkdud',
      email:'hap@ss',
    },
    {
      id: 2,
      username: 'rbgk',
      email:'pro@nn',
    },
    {
      id: 3,
      username: 'zzzz',
      email:'love@dd',
    }
  ];

  return (
    <div>
      {
        users.map(
        user => (<User user={user} key={user.id} />)
        )  
      }
      </div>
  );
};

export default UserList;
